- input: "TEXT\x1CC00143743\x1C1\x1C\x1CF3XA\x1CThe Party is amending the May Monthly
    report filed on May 20, 2014, to include Schedule L inadvertently omitted on the
    originally filed report. Line 21b reports reimbursements for travel expenses which
    are not itemized because they do not exceed the 200 dollar itemization level and
    do not exceed the 200 dollar aggregate per vendor amount.  With respect to the
    expenditures made by the Party for payroll, payroll taxes, and other payroll or
    employee benefit-related expenses, the Party adheres to 11 CFR 300.33, and also
    follows the Commissions revision of the rules as adopted on December 1, 2005.
    Specifically, the Party pays for these costs with 100 percent federal funds when
    the employee spends more than 25 percent of his or her time in a pay period on
    federal election activity FEA or activity in connection with a federal election.
    These expenditures are reported on Schedule B for Line 30b.  Alternatively, when
    an employee does not meet the 25 percent threshold, the Party allocates these
    costs as an overhead/administrative expense, and reports these disbursements on
    Schedule H4.  Additionally, employees payroll and reimbursed expenses are paid
    according to the activities they participate in, whether it is a fully federal
    or FEA activity, or an administrative or otherwise permissible allocated activity,
    as indicated by the documentation provided by the employee.  Transfers from federal
    to non-federal accounts were made for cash flow purposes unless otherwise disclosed.
    These funds do not represent a reimbursement of funds to the non-federal account
    for disbursements made to influence the election or defeat of federal candidates.
    \ The Republican Party of Texas uses a tickler system to track transfers of non-federal
    funds for allocated administrative expenditures to comply with 11 CFR 106.6(e)(2)
    and 106.7(f)(2) of the election code, in making timely transfers no more than
    10 days before or 60 days after the payment to vendors of federal funds.   By
    permission of donor, the excess contribution made by Elloine M. Clark on March
    11, 2014, in the amount of $1,280 was transferred to the non-federal account on
    April 7, 2014.  The transfer from Cornyn Majority Committee (CMC) on April 7,
    2014, in the amount of $17,938.93 consisted of $200 from Barry G. Andrews (February
    12, 2014 donation date to CMC), $6,000 from Hushang Ansary (February 27, 2014
    donation date to CMC) and $6,000 from Shahla Ansary (February 27, 2014 donation
    date to CMC) and $10,000 from Julia J. Matthews (February 20, 2014 donation date
    to CMC) less the Party's appropriate share of operating expenses as reported on
    CMC's FEC reports.\n"
